import React, {useState} from "react"
import CUButton from "../../components/CUButton/CUButton"
import Dialog from "../../components/Dialog/Dialog"

const Home = () => {
    const [isOpen, setIsOpen] = useState(false)

    const handleCloseDialog = () =>{
        setIsOpen(false)
    }

    return <div>
        <CUButton onClick={() => setIsOpen(true)}></CUButton>
        <Dialog open={isOpen} title="HOLA" onClose={handleCloseDialog}></Dialog>
    </div>
 
}



export default Home
